import React, { Component } from 'react';
import Bar from './Bar'
import './Login.css'


class Addmin extends Component {
    render() {
        return (
            <div className="BGL">
                <Bar />
                <div class="container">
                    <div class="row">
                        <div class="col-sm">
                            One of three columns
                        </div>
                        <div class="col-sm">
                            One of three columns
                        </div>
                        <div class="col-sm">
                            One of three columns
                        </div>
                    </div>
                </div>



                <br /><br />
            </div>
        );
    }

}
export default Addmin;
